import React from 'react';
import Header from './Header';

function Login() {
    return (
        <div className="Login">
            <form className="popup__form" onSubmit={onSubmit}>
              <h2 className="popup__title">Вход</h2>
              <input
                type="email"
                required
                className="popup__input popup__input_name_title"
                placeholder="Email"
                // onChange={}
              />
              <input
                type="password"
                required
                className="popup__input popup__input_name_title"
                placeholder="Пароль"
                // onChange={}
              />
              <button type = "submit" className="popup__save">Войти</button>
            </form>  
        </div>  
    )
}
    
export default Login;
